import React, { useEffect, useState } from "react";
import { ActivityIndicator, FlatList, Text, ToastAndroid, TouchableOpacity, View, Modal, StatusBar, Alert, Platform, PermissionsAndroid, Dimensions, Image } from "react-native";
import { useNavigation } from '@react-navigation/native';
import RNHTMLtoPDF from 'react-native-html-to-pdf';
import { FileSystem } from 'react-native-file-access';
import Icon from 'react-native-vector-icons/FontAwesome';
import PDF from 'react-native-pdf';

import ExecuteQuery from '../../sql';
import estilo from './style';

export default () => {

  const navigation = useNavigation()

  const [dados, setDados] = useState([])
  const [visivel, setVisivel] = useState(false)
  const [selectItem, setSelectItem] = useState('')
  const [loading, setLoading] = useState(false)
  const [createPDF, setCreatePDF] = useState(0)
  const [pdfView, setPdfView] = useState(false)
  const [localFile, setLocalFile] = useState('')
  const [nPages, setNPages] = useState(0)
  const [dadosGerais, setDadosGerais] = useState([])
  const [dadosPDF, setDadosPDF] = useState([])
  const [matUtil, setMatUtil] = useState([])
  const [servUtil, setServUtil] = useState([])

  useEffect(()=>{
    const unsubscribe = navigation.addListener('focus', async ()=> {
      setDados([])
      await SelectDados()
      setDadosGerais([])
      await selectDadosGerais()
    })
    return unsubscribe
  },[navigation])

  useEffect(()=>{
    if(createPDF > 0)
    gerarPDF(dadosGerais, dadosPDF, matUtil, servUtil)
  },[createPDF])

  async function selectDadosGerais(){
    let selectDGeral = await ExecuteQuery('SELECT * FROM dadosGerais')
    setDadosGerais(selectDGeral.rows.item(0))
  }

  function convertPadrao(valor) {
    
    if(valor.length <= 6) {
        return `${valor.substring(0,valor.length -3)},${valor.substring(valor.length -2)}`
    }else {
        return `${valor.substring(0,valor.length -6)}.${valor.substring(valor.length -6,valor.length -3)},${valor.substring(valor.length -2)}`
    }
}

  async function gerarPDF(dadosGerais, dadosPDF, matUtil, servUtil){

    let servicos = []
    let materiais = []
    for(let i = 0; i < matUtil.length; i++) {
      materiais.push([matUtil[i].descricao, matUtil[i].marca, matUtil[i].modelo, matUtil[i].prazoEntrega, matUtil[i].qtdeMaterial, matUtil[i].vlMaterial])
    }
    
    for(let x = 0; x < servUtil.length; x++) {
      servicos.push([servUtil[x].descricao, servUtil[x].qtdeServico, servUtil[x].vlServico])
    }

    const html = `
    <html>
      <head>
        <style>
          body {
            font-size: 8px;
            margin: 0 25px 0 25px;
          }
          .cab{
            display: flex;
            justify-content: space-between;
            align-items: center;
          }
          .logo {
            width: 220px;
            height: 120px;
            margin-left: -2px;
            padding: 0;
          }
          .pCab {
            font-size: 12px;
            margin: 0;
            padding: 0;
          }
          .negrito {
            font-weight: bold;
          }
          .centralizado {
            text-align: center;
          }
          .orcCab {
            border: 2px solid black;
            border-radius: 20px 0 20px 0;
            padding: 15px 25px 15px 25px;
            margin-right: 5px;
          }
          hr.single {
            border: 1px solid black;
            margin: 1px;
          }
          hr.double {
            border: 2px solid black;
            margin: 1px;
          }
          .info {
            font-size: 10px;
            margin: 0;
          }
          .title {
            font-weight: bold;
            background-color: #ddd;
            padding: 5px;
            font-size: 16px;
          }
          table {
            width: 100%;
          }
          th {
            border-bottom: 3px solid black;
          }
          .item {
            text-align: center;
          }
          .totais {
            text-align:end; 
            border-bottom: 2px solid black;
            border-top: 3px solid black;
            font-weight: bold;
            text-align: center;
            font-size: 14px;
          }
        </style>
      </head>
      <body>
        <header>
        <hr class="single">
        <div class="cab">
          <div>
             <img src="data:image/png;base64," class="logo"/>
             </div>
             <div>
               <p class="pCab negrito centralizado">OCEÂNICA MOTORES</p>
               <p class="pCab negrito centralizado">Especializada em Motores e Equipamentos</p>
               <p class="pCab centralizado">End: ${dadosGerais.endereco}</p>
               <p class="pCab centralizado">Contato: ${dadosGerais.contato}</p>
               <p class="pCab centralizado">E-mail: ${dadosGerais.email}</p>
             </div>
             <div class="orcCab">
               <p class="pCab negrito">Orçamento: ${dadosPDF[0].nOrcamento}</p>
               <p class="pCab negrito">Data: ${dadosPDF[0].data}</p>
               <p class="pCab negrito">Aprovado:</p>
             </div>
           </div>
           </header>
           <hr class="single"/>
           <hr class="single"/>
           <div>
             <p class="info"><span class="negrito">Cliente: ${dadosPDF[0].nomeCliente} </span></p>
             <p class="info"><span class="negrito">Equipamento / Embarcação: ${dadosPDF[0].embarcacao} - ${dadosPDF[0].embModelo}</span></p>
             <p class="info"><span class="negrito">Responsável: ${dadosPDF[0].responsavel}</span></p>
           </div>
           <hr class="double"/>
           <div>
             <p class="title">SERVIÇOS</p>
             <hr class="single"/>
             <table>
               <thead>
                 <tr>
                   <th>Item</th>
                   <th>Descrição</th>
                   <th>Qtde</th>
                   <th>Valor</th>
                   <th>Valor Total</th>
                 </tr>
               </thead>
               <tbody>
               ${servicos.map( (lines, index) => `
               <tr>
                 <td class="item" style="width: 50px;">${index + 1}</td>
                 <td class="item">${lines[0]}</td>
                 <td class="item" style="width: 50px;">${lines[1]}</td>
                 <td class="item" style="width: 100px">${convertPadrao(String(lines[2].toFixed(2)))}</td>
                 <td class="item" style="width: 100px">${convertPadrao(String((lines[1] * lines[2]).toFixed(2)))}</td>
               </tr>
               `,)
               .join('')
             } 
               </tbody>
               <tfoot>
                 <tr>
                   <td></td>
                   <td></td>
                   <td></td>
                   <td class="totais">TOTAL:</td>
                   <td class="totais">R$ ${convertPadrao(String(dadosPDF[0].vlServTot.toFixed(2)))}</td>
                 </tr>
               </tfoot>
             </table>
           </div>
           <div>
             <p class="title">MATERIAIS</p>
             <hr class="single">
             <table>
               <thead>
                 <tr>
                   <th>Item</th>
                   <th>Descrição</th>
                   <th>Qtde</th>
                   <th>Valor Un</th>
                   <th>Valor Total</th>
                   <th>Prazo Entrega</th>
                 </tr>
               </thead>
               <tbody>
               ${materiais.map( (lines, index) => `
               <tr>
                 <td class="item" style="width: 50px">${index + 1}</td>
                 <td class="item">${lines[0]} - ${lines[1]} - ${lines[2]}</td>
                 <td class="item" style="width: 50px">${lines[4]}</td>
                 <td class="item" style="width: 100px">${convertPadrao(String(lines[5].toFixed(2)))}</td>
                 <td class="item" style="width: 100px">${convertPadrao(String((lines[4] * lines[5]).toFixed(2)))}</td>
                 <td class="item" style="width: 100px">${lines[3]}</td>
               </tr>
               `,)
               .join('')
             } 
               </tbody>
               <tfoot>
                   <tr>
                       <td></td>
                       <td></td>
                       <td></td>
                       <td></td>
                       <td class="totais">TOTAL:</td>
                       <td class="totais">R$ ${convertPadrao(String(dadosPDF[0].vlMatTot.toFixed(2)))} </td>
                   </tr>
               </tfoot>
             </table>
             <p class="totais" style="text-align: start; background-color: #ddd; font-size: 15px">VALOR TOTAL DOS SERVIÇOS E MATERIAIS:<span style="margin-left: 282px; margin-right: 10px; margin-top: 25px; margin-bottom: 25px">R$ ${convertPadrao(String(dadosPDF[0].vlTotal.toFixed(2)))} </span></p>
           </div>
           <hr class="single"/>
           <div>
             <p class="title">Forma de Pagamento: ${dadosGerais.formPag}</p>
             <p class="info">Banco: ${dadosGerais.banco}</p>
             <p class="info">Ag: ${dadosGerais.agencia}</p>
             <p class="info">C/C: ${dadosGerais.conta}</p>
             <p class="info">CNPJ: 41.060.490/0001-07</p>
             <p class="info">Oceanica Motores</p>
             <p class="info">PIX ${dadosGerais.pix}</p>
           </div>
           <div>
             <p class="title">Prazo de Entrega: <span>${dadosPDF[0].prazoEntrega} dias após Aprovação</span></p>
           </div>
           <div>
             <p class="title">Disposições Finais</p>
             <p class="info">Validade desse orçamento: 15 dias a contar da data de emissão.</p>
             <p class="info">As peças que não forem indicadas como IMEDIATO, considerar o prazo de entrega do fornecedor.</p>
             <p class="info">Os serviços serão agendados após o pagamento da entrada e o recebimento de autorização do cliente.</p>
             <p class="info">O prazo de entrega será de 10 DIAS APÓS A PROVAÇÃO DO ORÇAMENTO e poderá sofrer alteração,</p>
             <p class="info">de acordo com a entrega de material pelo fornecedor.</p>
             <p class="info">Quando houver necessidade técnica de inclusão de peças ou serviços, que não constem no orçamento</p>
             <p class="info">inicial, o cliente será devidamente informado e deverá autorizar as alterações especificadas.</p>
             <p class="info">A GARANTIA dos serviços é de 90 dias após a entrega final.</p>
             <p class="info">A GARANTIA dos materiais ou peças será conforme fabricante.</p>
           </div>
         </body>
         <footer>
           <hr class="single"/>
           <p class="negrito" style="margin: 30px;">APROVADO:<spam style="margin-left: 30px;">( )Sim</spam><span style="margin-left: 30px;">( )Não</span></p>
           <hr class="single"/>
           <p class="negrito"><span style="margin-left: 50px;">DATA:</span><span style="margin-left: 250px;">Ass. Cliente / Responsável:</span></p>
         </footer>
       </html>
       `
    setLoading(true)

    try{
      const options = {
        html,
        fileName: 'Orcamento',
        directory: 'PDF',
      }

      var file = await RNHTMLtoPDF.convert(options)
    }catch (error){
      Alert.alert('Erro', error.message)
    }
    if(Platform.OS === 'android') {
      const dir = file.filePath.substring(0, 66)
      if(!FileSystem.exists(dir)) {
        console.log("Diretorio não encontrado.")
        return
      } 
      const granted = await PermissionsAndroid.request(
        PermissionsAndroid.PERMISSIONS.WRITE_EXTERNAL_STORAGE,PermissionsAndroid.PERMISSIONS.READ_EXTERNAL_STORAGE,
        {
          title: 'Permitir acesso ao armazenmento',
          message: 'Para gravação do PDF é preciso liberar o acesso ao armazenamento.',
          buttonNeutral: 'Pergunte-me depois',
          buttonNegative: 'Negar',
          buttonPositive: 'Permitir'
        }
      )
      if(granted === PermissionsAndroid.RESULTS.GRANTED) {
        await FileSystem.cpExternal(file.filePath, `Orcamento-${dadosPDF[0].nOrcamento}.pdf`, 'downloads')
        setLocalFile(file.filePath)
        setLoading(false)
        Alert.alert('Informação', 'O PDF foi salvo na pasta Downloads.')
        setPdfView(true)
      } else {
        Alert.alert('ERRO', 'O APP não pode gerar o PDF por falta de permissão')
      }
    }
    setCreatePDF(0)
  }

  if(pdfView){
    const source = {uri:`file:${localFile}`}
    return(
      <View style={estilo.viewPDF}>
        <View style={estilo.viewCabPDF}>
          <TouchableOpacity
            style={estilo.btnPDF}
            onPress={()=>setPdfView(false)}
          >
            <Icon
              name="chevron-left" 
              size={20} 
              color={'#000'}
              style={{marginTop: 10, margin: 5}}
            />
          </TouchableOpacity>
            <Text style={estilo.textPDF}>VIZUALIZAÇÃO do PDF</Text>
        </View>
        <PDF 
          style={{flex: 1, width: Dimensions.get('window').width, }}
          source={source}
          onLoadComplete={(number, path) => {
            setNPages(number)
            // console.log(`paginas ${number}`)
          }}
          onError={(error) => {
            console.log(error)
          }}
        />
      </View>
    )
  }

  if(loading){
    return <View style={estilo.viewLoading}>
              <Text style={[estilo.title, {marginBottom: 90, fontSize: 35}]}>Gerando PDF ...</Text>
              <ActivityIndicator
                size= {90}
                color= '#aaa'
                animating={true}
                style={estilo.indicator}
              />
            </View>
  }

  async function SelectDadosPDF(id) {
    setDadosPDF([])
    let selectQuery = await ExecuteQuery('SELECT oc.*, cl.nome nomeCliente, cl.endereco, cl.telefone, cl.email, eb.nome embarcacao, eb.modelo embModelo, eb.responsavel FROM orcamentos oc INNER JOIN clientes cl ON oc.cliente = cl.id INNER JOIN embarcacoes eb ON oc.embarcacao = eb.id WHERE oc.id = ?',[id])
    let temp = []
    for(let i = 0; i < selectQuery.rows.length; i++) {
      temp.push(selectQuery.rows.item(i))
    }
    setDadosPDF([...temp])

    let selectMatUtil = await ExecuteQuery('SELECT mtu.*, mt.* from matUtilizados mtu left join materiais mt on mt.id = mtu.idmaterial WHERE mtu.idorcamento = ?',[id])
    let tempMat = []
    for(let x = 0; x < selectMatUtil.rows.length; x++) {
      tempMat.push(selectMatUtil.rows.item(x))
    }
    setMatUtil([...tempMat])

    let selectServ = await ExecuteQuery('SELECT * from ServUtilizados WHERE idOrcamento = ?',[id])
    let tempServ = []
    for(let y = 0; y < selectServ.rows.length; y++) {
      tempServ.push(selectServ.rows.item(y))
    }
    setServUtil([...tempServ])

    setCreatePDF(id)
  }

  async function SelectDados() {

      let selectQuery = await ExecuteQuery('SELECT o.*, c.nome nomeCliente, e.nome nomeEmbarcacao FROM orcamentos o LEFT JOIN  clientes c  ON c.id = o.cliente LEFT JOIN embarcacoes e ON e.id = o.embarcacao ORDER BY o.nOrcamento')
      let temp = []
      for(let i = 0; i < selectQuery.rows.length; i++){
          temp.push(selectQuery.rows.item(i))
      }
      setDados([...temp])
  }

  function orcamentos(){
      navigation.navigate('Orcamentos')
  }

  async function deleteItem(data){

    const result_or = await ExecuteQuery('DELETE FROM orcamentos WHERE id = ?; DELETE FROM matUtilizados WHERE idOrcamento = ?; DELETE FROM ServUtilizados WHERE idOrcamento = ?',[data.id, data.id, data.id])
    if (result_or.rowsAffected > 0){
        ToastAndroid.show('Orçamento excluido com sucesso!', ToastAndroid.LONG)
    }else {
        ToastAndroid.show('Erro ao Excluir Orçamento!', ToastAndroid.LONG)
    }
    setVisivel(false)
  }

  function ListItem({ data }){
      return(
        <TouchableOpacity
          style={estilo.listItem}
          onPress={()=>{
            SelectDadosPDF(data.id)
          }}
          onLongPress={()=>{
            setSelectItem(data)
            setVisivel(true)}}
        >
          <StatusBar
            hidden={true}
          />
          <Modal
            animationType="fade"
            transparent={true}
            visible={visivel}
          >
            <View style={estilo.containerModal}>
              <View style={estilo.modal}>
                <Text style={estilo.tituloModal}>Confirmação</Text>
                <Text style={estilo.conteudo}>Confirma exclusão do orçamento?</Text>
                <View style={estilo.viewBtnModal}>
                  <TouchableOpacity
                    style={estilo.btnModal}
                    onPress={()=>{
                      deleteItem(selectItem)
                      // navigation.goBack()
                    }}
                  >
                    <Text style={estilo.textBtn}>OK</Text>
                  </TouchableOpacity>
  
                  <TouchableOpacity
                    style={estilo.btnModal}
                    onPress={()=>{
                      setVisivel(false)
                    }}
                  >
                    <Text style={estilo.textBtn}>Cancelar</Text>
                  </TouchableOpacity>
  
                </View>
              </View>
            </View>
          </Modal>
          <View style={estilo.item1}>
            <View>
              <Text style={estilo.label}>Orçamento</Text>
              <Text style={estilo.listData}>{data.nOrcamento}</Text>
            </View>
            <View>
              <Text style={estilo.label}>Data</Text>
              <Text style={estilo.listData}>{data.data}</Text>
            </View>
          </View>
          <View style={estilo.item1}>
            <View>
              <Text style={estilo.label}>Cliente</Text>
              <Text style={estilo.listData}>{data.nomeCliente}</Text>
            </View>
            <View>
                <Text style={estilo.label}>Embarcação</Text>
                <Text style={estilo.listData}>{data.nomeEmbarcacao}</Text>
            </View>
          </View>
        </TouchableOpacity>
      )
  }
  
  return(
      <View style={estilo.container}>
          <Text style={estilo.title}>ORÇAMENTOS</Text>
          <FlatList
            maxToRenderPerBatch = {10}
            removeClippedSubviews={true}
            extraData={dados}
            style={{marginTop: 20, width: '100%'}}
            showsVerticalScrollIndicator={false}
            contentContainerStyle={{marginHorizontal: 20}}
            data={dados.reverse()}
            keyExtractor={ item => String(item.id)}
            renderItem={({ item }) => <ListItem data={item}/>}
            ListEmptyComponent={<Text style={estilo.alert}>Nenhum Orçamento Encontrado</Text>}
          />
          <TouchableOpacity
              style={estilo.btn}
              onPress={orcamentos}
          >
          <Text style={estilo.textBtn}>Adicionar Orçamento</Text>
        </TouchableOpacity>
      </View>
  )
}